import React from 'react';

import './App.css';

function App() {
  return (

      <div className="grid-container">
        <header className="container">
          <h1 className="header1">Dairy For all<br/>Milk and Cheese </h1>

        </header>

        <main className="main">
         <p><br/>Welcome to our our website.<br/>We are group of farmers in the village,who sell organic and homemade dairy products.
         <br/>If you like to know more about our products </p>
        </main>
        <footer className="footer">For more information call us at :059-999999</footer>
      </div>

  );
}

export default App;
